insert into tab89p_3 values (1, (select ft.b from tab89p_1 ft, tab89p_2 sc where ft.b = sc.b and ft.c < sc.c
				union select sc.b from tab89p_1 ft, tab89p_2 sc where ft.b = sc.b and ft.c < sc.c),  1)

/* minus */
insert into tab89p_3 values (2, (select ft.b from tab89p_1 ft, tab89p_2 sc where ft.b = sc.b and ft.c >= sc.c
				minus  select sc.b from tab89p_1 ft, tab89p_2 sc where ft.b = sc.b and ft.c > sc.c and (sc.b not like 'bre%')),  2)

/* intersect */
insert into tab89p_3 values (2, (select ft.b from tab89p_1 ft, tab89p_2 sc where ft.b = sc.b and ft.c = sc.c
				intersect  select b from tab89p_1),  3)

/* union all */
insert into tab89p_3 values (2, (select ft.b from tab89p_1 ft, tab89p_2 sc where ft.b = sc.b and ft.c = sc.c
				union all  select sc.b from tab89p_1 ft, tab89p_2 sc where ft.b = sc.b and ft.c = sc.c),  2)

